from typing import Final

create_table_commands: Final = [
    """
    CREATE TABLE wp.users (
            user_id BIGSERIAL PRIMARY KEY UNIQUE NOT NULL,
            username VARCHAR(255) NOT NULL UNIQUE,
            password VARCHAR(255) NOT NULL,
            email VARCHAR(255) NOT NULL UNIQUE,
            phone VARCHAR(255) NOT NULL,
            disabled BOOLEAN NOT NULL
        );
    """,
    """
    CREATE TABLE wp.orders (
            order_id BIGSERIAL PRIMARY KEY UNIQUE,
            user_id BIGINT NOT NULL,
            FOREIGN KEY (user_id)
                REFERENCES wp.users
                ON UPDATE CASCADE
        );
    """,
    """
    CREATE TABLE wp.transactions (
            trans_id BIGSERIAL PRIMARY KEY UNIQUE NOT NULL,
            from_ts TIMESTAMP NOT NULL,
            to_ts TIMESTAMP NOT NULL,
            money NUMERIC(7,2) NOT NULL,
            order_id BIGINT NOT NULL,
            FOREIGN KEY (order_id)
                REFERENCES wp.orders
                ON UPDATE CASCADE
        );
    """,
    """
    CREATE TABLE wp.aois (
            geom_id BIGSERIAL PRIMARY KEY UNIQUE,
            order_id BIGINT NOT NULL,
            FOREIGN KEY (order_id)
                REFERENCES wp.orders (order_id)
                ON UPDATE CASCADE,
            geom geometry NOT NULL
        );
    """,
    """
    CREATE TABLE wp.files (
            file_id BIGSERIAL PRIMARY KEY UNIQUE,
            order_id BIGINT NOT NULL,
            FOREIGN KEY (order_id)
                REFERENCES wp.orders
                ON UPDATE CASCADE,
            geom_id BIGINT NOT NULL,
            FOREIGN KEY (geom_id)
                REFERENCES wp.aois
                ON UPDATE CASCADE,
            path VARCHAR(255) NOT NULL,
            wq_index VARCHAR(20) NOT NULL,
            file_extension VARCHAR(20) NOT NULL,
            date TIMESTAMP NOT NULL
        );
    """,
]

